import React from 'react';

class Task extends React.Component {
  render() {
    return (
      <div key={this.props.text} className='task'>
        <div className='label'>{this.props.category}</div>
        <div className='text'>{this.props.text}</div>
      </div>
    )
  }
}

export default Task;
